import React from 'react';
import { Container, Typography, Button, Box } from '@mui/material';

function Hero() {
  return (
    <Box
      sx={{
        backgroundColor: '#2a5e4f',
        paddingY: 10,
        textAlign: 'center',
        color: '#ffffff',
        backgroundImage: 'linear-gradient(to right, #2a5e4f, #132a47)',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
      }}
    >
      <Container maxWidth="md">
        <Typography variant="h2" sx={{ fontWeight: 'bold', marginBottom: 3 }}>
          Compete in the most trusted online fishing tournaments and win big from anywhere
        </Typography>
        <Typography variant="body1" sx={{ fontSize: '1.2rem', marginBottom: 5 }}>
          Join tournaments at the click of a button and fish alongside anglers from around the world.
        </Typography>
        <Button variant="contained" size="large" href="#signup" sx={{ backgroundColor: '#d6b98d', color: '#132a47', paddingX: 5, paddingY: 1.5, '&:hover': { backgroundColor: '#132a47', color: '#d6b98d' } }}>
          Get Started
        </Button>
      </Container>
    </Box>
  );
}

export default Hero;
